import React from 'react';
import doctor from  '../../Images/Wellcome/doctor.PNG'

const Welcome = () => {
    return (
        <div>
            <div>
                <img src={doctor} alt="" />
            </div>
            <div>
                <h1>Find </h1>
            </div>
        </div>
    );
};

export default Welcome;
